        <View style={{flexDirection: 'row',top: 50,alignItems: 'center'}}>
            <Text style={{marginLeft:'5%',color:'white',fontSize:22}}>Password lenght</Text>
            <View style={{borderWidth: 1,backgroundColor:'white',width:170,height:36,left: 20}}></View>
        </View>

        <View style={{flexDirection: 'row',top: 30,alignItems: 'center'}}>
           <Text style={{marginLeft:'5%',color:'white',fontSize:22}}>Include lower case letters</Text>
        </View>
    </View>
  );
};

export default YourApp;
